import logging
from datetime import datetime
from enum import Enum
from typing import List, Dict, Optional

# Logging setup
logging.basicConfig(
    level=logging.INFO,
    format='%(asctime)s - %(name)s - %(levelname)s - %(message)s',
    handlers=[
        logging.FileHandler('broker_app.log'),
        logging.StreamHandler()
    ]
)
logger = logging.getLogger('BrokerApp')

class PublishStatus(Enum):
    DRAFT = "Draft"
    PENDING = "Pending"
    PUBLISHED = "Published"
    FAILED = "Failed"

class UserRole(Enum):
    ADMIN = "Admin"
    SUBMISSION_MANAGER = "Submission Manager"
    DATA_PROCESSOR = "Data Processor"
    UI_DESIGNER = "UI Designer"
    BROKER_USER = "Broker User"
    DATA_MANAGER = "Data Manager"
    VALIDATOR = "Validator"
    DASHBOARD_USER = "Dashboard User"

class ValidationError:
    def __init__(self, error_code: str, message: str):
        self.error_code = error_code
        self.message = message

    def __str__(self):
        return f"{self.error_code}: {self.message}"

class Submission:
    def __init__(self, submission_id: str):
        self.submission_id = submission_id
        self.status = PublishStatus.DRAFT
        self.validation_errors: List[ValidationError] = []
        self.created_at = datetime.now()
        self.updated_at = datetime.now()

    def update_status(self, new_status: PublishStatus):
        self.status = new_status
        self.updated_at = datetime.now()
        logger.info(f"Submission {self.submission_id} status updated to {new_status.value}")

    def add_validation_error(self, error: ValidationError):
        self.validation_errors.append(error)
        logger.info(f"Added validation error to submission {self.submission_id}: {error}")

    def clear_validation_errors(self):
        self.validation_errors = []
        logger.info(f"Cleared validation errors for submission {self.submission_id}")

class User:
    def __init__(self, user_id: str, role: UserRole):
        self.user_id = user_id
        self.role = role

    def has_permission(self, required_role: UserRole) -> bool:
        return self.role == required_role

