class Validator:
    @staticmethod
    def validate_duns(duns_number: str) -> bool:
        # Simple validation logic
        is_valid = len(duns_number) == 9 and duns_number.isdigit()
        logger.info(f"DUNS number {duns_number} validation: {is_valid}")
        return is_valid

    @staticmethod
    def validate_zip(zip_code: str) -> bool:
        # Simple validation logic
        is_valid = len(zip_code) == 5 and zip_code.isdigit()
        logger.info(f"ZIP code {zip_code} validation: {is_valid}")
        return is_valid

    @staticmethod
    def validate_cfda(cfda_number: str) -> bool:
        # Simple validation logic
        is_valid = len(cfda_number) == 5 and cfda_number.isdigit()
        logger.info(f"CFDA number {cfda_number} validation: {is_valid}")
        return is_valid

class Dashboard:
    def __init__(self):
        self.submission_stats = {
            "total": 0,
            "draft": 0,
            "pending": 0,
            "published": 0,
            "failed": 0
        }

    def update_stats(self, submission: Submission):
        self.submission_stats["total"] += 1
        self.submission_stats[submission.status.value.lower()] += 1
        logger.info(f"Updated dashboard stats: {self.submission_stats}")

    def get_stats(self) -> Dict[str, int]:
        logger.info(f"Retrieved dashboard stats: {self.submission_stats}")
        return self.submission_stats
